import { HttpErrorResponse } from '@angular/common/http';
import { Component } from '@angular/core';
import { Router, ActivatedRoute } from '@angular/router';
import { AngioIRMCerbrale } from 'src/app/models/AngioIRMCerbrale';
import { echodopplerTransc } from 'src/app/models/echodopplerTransc';
import { EvaluationRendement } from 'src/app/models/EvaluationRendement';
import { AngioirmService } from 'src/app/services/angioirm.service';
import { EchodopplerService } from 'src/app/services/echodoppler.service';
import { RendementService } from 'src/app/services/rendement.service';

@Component({
  selector: 'app-updaterendement',
  templateUrl: './updaterendement.component.html',
  styleUrls: ['./updaterendement.component.css']
})
export class UpdaterendementComponent {
  EvaluationRendement: any= {};
  AngioIRMCerbrale: any= {};
  echodopplerTransc: any={};
  errorMessage: string = '';

  constructor(
    private RendementService: RendementService,
    private AngioirmService:AngioirmService,
    private EchodopplerService:EchodopplerService,
    private router: Router,
    private route: ActivatedRoute
  ) {}

  
  ngOnInit(): void {
    this.route.paramMap.subscribe(params => {
      const PatientID = params.get('PatientID');
      if (PatientID) {
        const id = parseInt(PatientID, 10);
        if (!isNaN(id)) {
          this.getById(id);
          this.getById1(id);
          this.getById2(id);


        } else {
          console.error('Invalid patient ID:', PatientID);
        }
      } else {
        console.error('Patient ID is missing in route');
      }
    });
  }
  
  
  private getById(id: number) {
    this.RendementService.getById(id).subscribe(
      (data: EvaluationRendement) => {
        this.EvaluationRendement = data;
        console.log('Formatted data:', this.EvaluationRendement);
      },
      (error: HttpErrorResponse) => {
        this.errorMessage = error.message;
        console.error('Error fetching complication data:', error);
      }
    );
  }
  
  private getById1(id: number) {
    this.AngioirmService.getById(id).subscribe(
      (data: AngioIRMCerbrale) => {
        this.AngioIRMCerbrale = data;
        console.log('Formatted data:', this.AngioIRMCerbrale);
      },
      (error: HttpErrorResponse) => {
        this.errorMessage = error.message;
        console.error('Error fetching complication data:', error);
      }
    );
  }
  
  private getById2(id: number) {
    this.EchodopplerService.getById(id).subscribe(
      (data: echodopplerTransc) => {
        this.echodopplerTransc = data;
        console.log('Formatted data:', this.echodopplerTransc);
      },
      (error: HttpErrorResponse) => {
        this.errorMessage = error.message;
        console.error('Error fetching complication data:', error);
      }
    );
  }
  

  
  

  onSubmit() {
    const patientID = parseInt(this.route.snapshot.paramMap.get('PatientID')!, 10);
    if (!isNaN(patientID)) {
        this.RendementService.update(patientID, this.EvaluationRendement).subscribe(
            response => {
                console.log('Update successful', response);
                //this.router.navigate(['/']); // Adjust this to your desired route after successful update
            },
            (error: HttpErrorResponse) => {
                this.errorMessage = error.message;
                console.error('Error updating complication data:', error);
            }
        );
        this.AngioirmService.update(patientID, this.AngioIRMCerbrale).subscribe(
          response => {
              console.log('Update successful', response);
              //this.router.navigate(['/']); // Adjust this to your desired route after successful update
          },
          (error: HttpErrorResponse) => {
              this.errorMessage = error.message;
              console.error('Error updating complication data:', error);
          }
      );
      this.EchodopplerService.update(patientID, this.echodopplerTransc).subscribe(
        response => {
            console.log('Update successful', response);
            //this.router.navigate(['/']); // Adjust this to your desired route after successful update
        },
        (error: HttpErrorResponse) => {
            this.errorMessage = error.message;
            console.error('Error updating complication data:', error);
        }
    );
    } else {
        console.error('Invalid patient ID:', patientID);
    }
}

}
